import React from 'react'
import LogOutButton from './LogOutButton';
import { StyledToolBar } from '../styles/StyledToolbar';

const ToolBar = () => {
    return (
        <StyledToolBar>
            <LogOutButton />
        </StyledToolBar>
    )
}

export default ToolBar;
